import React from 'react';
import './App.css';
import Navbar from './components/Navbar';

//contents
import Home from './contents/Home' 
import About from './contents/About' 


import { BrowserRouter as Router, Route} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
          <Routes exact part="/">
            <Home/>
          </Routes>
          <Routes exact part="/">
            <About/>
          </Routes>
      </div>
    </Router>
  );
}

export default App;
